import Addtrasaction from './components/Addtrasaction';
import { GlobalProvider } from './components/context/GlobalState';

function App() {
  return (
    <GlobalProvider>
      <Header/>
      <div className='container'>
      <Balance/>
      <IncomeExpenses/>
      <TrasactionList/>
      <Addtrasaction/>
      </div>

    </GlobalProvider>

  );
}

export default App;
